        b.put("FUTURE_PAYMENT_LEGAL_DETAILS|AU", "<h1><strong>Fremtidig betalingsaftale</strong></h1><p>Appen kan simulere en lille pr\370vetransaktion for at sikre, at der kan tr\346kkes penge p\345 din PayPal-konto i fremtiden, men der vil ikke blive trukket nogen penge.</p><p>Din foretrukne betalingsmetode (din PayPal-saldo, din tilknyttede bankkonto eller dit betalingskort i denne r\346kkef\370lge) vil blive brugt, n\345r du betaler med PayPal. Bem\346rk, at din bank eller kortudsteder muligvis opkr\346ver et gebyr, hvis der ikke er nok penge til at d\346kke k\370bet med din foretrukne betalingsmetode.</p><p>Hvis du vil annullere denne aftale, skal du logge p\345 din PayPal-konto og g\345 til <strong>Min profil</strong>. Klik derefter p\345 <strong>Mine indstillinger</strong> og <strong>Skift</strong> ud for \u201CLog p\345 med PayPal\u201D.</p>");
